import { Link } from "react-router-dom";
import { useState } from "react";
import Topbar from "./sub-components/Topbar";
import Bottombar from "./sub-components/Bottombar";
import Profile from "./sub-components/Profile";
import Urlhistory from "./sub-components/Urlhistory";
import Generate from "./sub-components/Generate";
function Dashboard() {
  const [section, setSection] = useState(<Profile />);

  const handleSection = () => {};

  return (
    <>
      <Topbar value="Log out" link="/"></Topbar>
      <div className="dash-container">
        <div className="container">
          <div className="row">
            <div className="col-lg-3">
              <div
                className="d-flex flex-column flex-shrink-0 text-dark"
                style={{ width: "250px" }}
              >
                <div className="nav nav-pills flex-column text-white mt-5">
                  <Link
                    className="nav__item mb-3"
                    to="/profile"
                    component={Profile}
                  >
                    <i class="far fa-user me-3"></i>
                    <span className=""> Profile</span>
                  </Link>
                  <Link
                    className="nav__item mb-3"
                    to="/generate"
                    component={Urlhistory}
                  >
                    <i class="fas fa-link me-3"></i>
                    <span>Generate URLs</span>
                  </Link>
                  <Link className="nav__item mb-3" to="/history">
                    <i class="fas fa-history me-3"></i>
                    <span>Previous work</span>
                  </Link>
                </div>
              </div>
            </div>
            <div className="col-lg-9 dash-bg">
              <Profile />
            </div>
          </div>
        </div>
      </div>
      <Bottombar />
    </>
  );
}

export default Dashboard;
